import React from 'react'

export default function EmailCheckbox() {
    return (
        <div className="w-80 pl-3 flex flex-row items-center space-x-6">
            <input className="transform scale-150" type="checkbox" />
            <div>
                <p>
                    Você gostaria de receber as melhores novidades vindas do espaço em seu email?
                </p>
            </div>
        </div>
    )
}
